import React from 'react';

import Alert from 'react-bootstrap/Alert';

const Alerts = ({ alertObj }) => {
  const { show, msg, type } = alertObj;
  return (
    <Alert show={show} variant={type}>
      {msg}
    </Alert>
  );
};

export default Alerts;
